const API_SERVER = "http://127.0.0.1:8000/api/v1"


const profileApi = {
    getProfileBySlug: async (api, slug) => {

        const response = await api.get(`${API_SERVER}/profile/${slug}/`)
        return  response

    }
}

export default profileApi
